import React from 'react';
import {Slider} from 'react';

const MySlider = () => {
    return ( 
        <Slider   
        aria-label="Temperature"
        defaultValue={30}
        getAriaValueText={valuetext}
        valueLabelDisplay="auto"
        step={10}
        marks
        min={10}
        max={110}>

        </Slider>
    );
}
 
export default MySlider;
